import React from "react";
import css from "@emotion/css";
import { COLORS } from "../../../constants";
const RightInfo = ({ pInfo }) => {
  const rhProfileData = pInfo && pInfo.profile;
  return (
    <React.Fragment>
      <div
        className="p-3"
        css={css`
          background-color: #e6e6e6;
        `}
      >
        <div
          className="block p-4"
          css={css`
            background-color: #728498;
          `}
        >
          {rhProfileData &&
            rhProfileData.length > 0 &&
            rhProfileData.map((rhp) => (
              <div key={rhp}>
                <img
                  className="w-40 m-auto block py-4"
                  src="https://image.flaticon.com/icons/svg/848/848006.svg"
                  alt="profile"
                  title="profile"
                />
                <p
                  className="bg-white w-6/12 m-auto text-center p-2 shadow uppercase text-blue-400"
                  css={css`
                    color: #728498;
                  `}
                >
                  {rhp.firstName}
                </p>
              </div>
            ))}
        </div>
      </div>
    </React.Fragment>
  );
};

export default RightInfo;
